  render() {
    const { greetingsMessage, match: {params: { id }} } = this.props;
    return (
      <div>
        <h2>Users</h2>
        <p> { `${greetingsMessage} User ${id}` }, this is My awesome Users component </p>
      </div>
    );
  }
};

export default Users;
